import React, { useEffect, useState, useRef } from 'react'

function UserAdminBox() {
    const email = useRef()
    const password = useRef()
    const againpassword = useRef()




    email.current.value = ''
    password.current.value = ''
    againpassword.current.value = ''

    return (
        <>
            <div className="container">
                <form action="" method="post">
                    <label htmlFor="email">Email</label>
                    <input ref={email} type="email" id="email" name="email" placeholder="Email.." />

                    <label htmlFor="password">Password</label>
                    <input ref={password} type="password" id="password" name="email" placeholder="Password.." />

                    <label htmlFor="againpassword">Again Password</label>
                    <input ref={password} type="password" id="againpassword" name="email" placeholder="Password.." />

                    <button className='button' type="button" onClick={props.sendFunc}>Send</button>
                </form>
            </div>
        </>
    )
}

export default UserAdminBox;
